var count  = 0
var loop = 1000000

func X(aa a) {
	count++
	if count > loop {
		fmt.Printf("\n sleep X")
		time.Sleep(60 * time.Second)
		return
	}
	X(aa)
}

func Y(aa *a) {
	count++
	if count > loop {
		fmt.Printf("\n sleep Y")
		time.Sleep(60 * time.Second)
		return
	}
	Y(aa)
}

